  body {

}

body.postj5 img {
    zoom: 75%
}
    
.page {

}
    
.content {

}
    
h1 {
    font-family:Arial,sans-serif;
    font-style: bold;

}
    
body.postj4 h1, body.postj5 h1 {
    font-size: 18px;
}
    
h2 {
    font-family:Arial,sans-serif;
    font-style: italic;
    font-size: 13pt;

}
    
body.postj4 h2, body.postj5 h2 {
    font-size: 17px;
}
    
h3 {
    font-style: bold;
    font-size: 13pt;
    margin: 15px 0 2px 0;
}
    
body.postj4 h3, body.postj5 h3 {
    font-size: 17px;
}
    
header {
    font-weight:700;
    font-size:13pt;
    margin: 5px 5px 10px 0px;
}
    
em {
    font-size:13pt;
    font-weight:700;
    font-style:normal;
}
    
li {
    margin: 0px 0px 0px 20px;   
}
    
a span,a li,.activeLink {
    border-bottom:1px dotted;
}
    
.activeLink:hover {
    color:#FFFFFF;
    background-color:#000000;
}
    
.solidBottom {
    border-bottom:1px solid;
    color: black;
    display: inline-block;
    line-height: 130%;
    text-decoration: none;
}
    
.linkClicked {
    font-style: italic;
}
    
a {
    color:#000;
    text-decoration:none;
}
    
div.hr {
    border-top:1px dashed;
    height:0;
}
    
ul,figure {
    margin:0;
    padding:0;
}
    
img {
    margin: 5px;
    vertical-align: top;
}
.headline {
    clear: both;
    margin: 15px 0 10px 0;
}
.subheadline {
    font-size:13pt;
    color:#666;
    font-weight:700;
}
    
.summary {
    font-size:18px;
    font-weight: normal;
    line-height: 125%;
}
    
.fineprint {
    font-size:18px;
    font-weight: normal;
    line-height: 125%;
}
    
.nomargin {
    margin: 0;
}
    
.action {
    margin: 50px 20px 50px 20px;

    float: right;

}
    
.returnToMain, .cancelByAccident {
    position: absolute;
    left: 200px;

    width: 142px;
    font-size: 16px;
}
    
a.buy-kso:hover {
    background: none repeat scroll 0 0 #000000;
    color: #FFFFFF;
}

}
